import './App.css';
import Button from '@mui/material/Button';

const titleDiv = ()=> {
 return ( 
 <div className='titleDiv'>
    <h1> Title test !</h1>
 </div>)
}

const controlsBar= () => {
  return (
    <div className='controlsBar'>
        <Button variant="contained">Contained</Button>
        <Button variant='text'> Button 2 </Button>
        <Button variant='text'> Button 3 </Button>
    </div>
  )
}


function App() {
  return (
    <div className="App">


      {titleDiv()}
      {/* {controlsBar()} */}
    </div>
  );
}

export default App;
